import { NaticoCommandHandler, NaticoClient } from "./deps.ts";
class BotClient extends NaticoClient { constructor(public options?: NaticoClientOptions) { super(options); } // This is the command handler that will be handling your commands commandHandler: NaticoCommandHandler = new NaticoCommandHandler(this, { directory: "./commands", prefix: "!", }); async start(token: string) { // Loading its modules await this.commandHandler.loadALL(); //Then just simply login return this.login(token); }
}
const botClient = new BotClient({ intents: ["Guilds", "GuildMessages", "GuildVoiceStates"],
});
botClient.start("Insert your token here");

